    <p class=MsoListParagraph style='margin-left:0cm;mso-add-space:auto;
    text-align:justify;line-height:115%'><span lang=EN-US style='font-size:
    12.0pt;line-height:115%;font-family:"Arial",sans-serif'>For the initial
    state, the constant volume of the container is considered as known, the
    medium will be air because variables such as density, temperature and
    humidity are equal inside and outside the chamber in the first interval
    from room temperature to 60 °C. The 5 watts electric heating element (Ra)
    is the actuator in this temperature zone, then the 150-watt electric
    heating element to heat the systems up to 200°C and finally the cooling
    effect (<span class=SpellE>Rc</span>). It is better to let the system start
    from rest at room temperature, using equation 1, <b style='mso-bidi-font-weight:
    normal'>[17].</b></span><span lang=EN-US style='font-size:12.0pt;
    mso-bidi-font-size:11.0pt;line-height:115%;mso-ascii-font-family:Calibri;

    <p class=MsoNormal style='text-align:justify;line-height:115%'><span

    from the first law of thermodynamics on the conservation of energy,
    equating the heat Q=W, where Q is the heat supplied by the system to the
    medium (container) and W is the work done by the medium (container) to the
    system during the cycle.<o:p></o:p></span></p>

    <p class=MsoNormal style='text-align:justify'><span lang=EN-US
    style='font-size:12.0pt;mso-bidi-font-size:10.0pt;font-family:"Arial",sans-serif;
    mso-ansi-language:EN-US'>To obtain the physical model it was necessary to
    use a container with a known volume that would allow adding sensors and
    maintaining a treatment space (St) for the products to be treated. Then, an
    important consideration was the need of a low cost system and finally any
    person or group, with a minimum knowledge base, could build that. For the
    demonstration prototype, temperature sensors were added to the actuators
    and to the internal and external dry air volumes, humidity sensors,
    pressure and electrical current.<o:p></o:p></span></p>

  <![if !mso]>

   <tr>
    <td><![endif]>
    <div>
    <p class=papertitle style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto;text-align:justify'><span lang=EN-US style='font-size:12.0pt;
    font-family:"Arial",sans-serif'>For this, it is necessary to start from the
    conceptual idea of &#8203;&#8203;the system to be developed, and for this,
    the need for a system that allows generating temperature ramps from room
    temperature to about 120ºC of temperature is defined. Some requirements are
    that the volume and pressure are constant and that the system is closed to
    allow measuring sensors, devices, biological material and their responses
    in temperature with constant pressure and volume conditions and thus find
    the mass (only applies to biological materials). On the other hand, the
    system must allow going from room temperature to -10 ºC to test other
    materials or liquids and see if fractures are created. The system must be
    able to go from high to low temperature, and from low to high, also
    allowing stability at a temperature over time. <o:p></o:p></span></p>
    <p class=papertitle style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto;text-align:justify'><span lang=EN-US style='font-size:12.0pt;
    font-family:"Arial",sans-serif'>In addition to all this, applications such
    as incubation periods of biological material, temperature ramps,
    temperature inversion and stability for periods, creation of controlled
    disturbances, maximum and minimum values, all these conditions must be
    considered. Other aspects also come into play, such as costs and the public
    to whom the development is directed.<o:p></o:p></span></p>
    <p class=MsoNormal style='text-align:justify'><span lang=EN-US
    style='font-size:12.0pt;font-family:"Arial",sans-serif;mso-ansi-language:
    EN-US'><o:p>&nbsp;</o:p></span></p>
    <p class=papertitle style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto;text-align:justify'><span lang=EN-US style='font-size:12.0pt;
    mso-bidi-font-size:11.0pt;font-family:"Calibri",sans-serif;mso-ascii-theme-font:
    minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:"Times New Roman";
    mso-bidi-theme-font:minor-bidi;mso-bevel-captop-bevelstyle:12;mso-bevel-captop-dpiwidth:
    4.5pt;mso-bevel-captop-dpiheight:3.0pt;mso-bevel-capbot-bevelstyle:0;
    mso-bevel-capbot-dpiwidth:0pt;mso-bevel-capbot-dpiheight:0pt;mso-bevel-material:
    8;mso-bevel-dpiextrusion:4.5pt;mso-bevel-dpicontour:0pt'><o:p>&nbsp;</o:p></span></p>

    however, it reaches its maximum temperature in a few minutes, forcing its
    disconnection to avoid damage. In order to exercise a control action on

    will regulate the supply current to the element through the switching of
    optocouplers DIAC DB32 and TRIAC BTA08400B, generating four different
    states of regulation at 115/220 VAC (rms). A solid-state relay (SSR) with
    appropriate switching times can replace the illustrated circuit.<o:p></o:p></span></p>

    <p class=papertitle style='margin-bottom:0cm;margin-bottom:.0001pt;
    text-align:justify;line-height:115%'><span lang=EN-US style='font-size:
    12.0pt;line-height:115%;font-family:"Arial",sans-serif;mso-fareast-font-family:
    SimSun'>The developed system is based on a closed container with a
    transient air flow, in order to determine at certain times in a confined
    and known space, a thermal condition that allows us to make measurements
    under controlled and stable conditions, however the thermodynamic laws of
    energy and matter exchange are applied since the system takes and exchanges
    these conditions frequently. In this case there are exchanges of energy
    between hot and cold objects or air, vapor and oxygen molecules.<o:p></o:p></span></p>
    <p class=MsoNormal style='mso-margin-top-alt:auto;mso-margin-bottom-alt:

    <p class=papertitle style='mso-margin-top-alt:auto;mso-margin-bottom-alt:
    auto;text-align:justify'><span lang=EN-US style='font-size:12.0pt;
    font-family:"Arial",sans-serif'>In order to generate a modeling theory for
    a system like this, it is necessary once the conceptual idea, the
    phenomena, the variables and some aspects of operation are known, the next
    objective is to model a system, to characterize it mathematically and find
    a way to describe it more thoroughly in a more complete, precise, detailed
    and exact way, with all this information it will be used to perform
    analyses and generate all of the automatic controllers and also the
    algorithms seeking that the operation is adapted to the requirements
    proposed for the interested public. It is essential to obtain physical data
    and numbers for the mathematical model, in this case table 5 shows the
    container, volume, weight, area and some properties in our case it consists
    of a series of equations that represent the behavior of the system, a
    thermal or thermodynamic section, another section on electronic design and
    device control, another section on control algorithms, proportional,
    integral and derivative, as can be seen all these equations do not
    represent a single model, each one has different representations on the
    system but they act in a different way, table 2 shows for example the heats
    of skin, blood, bones and muscles.<o:p></o:p></span></p>

  <td colspan=33 align=left valign=top><img width=848 height=307
  src="index_file/image026.png"
  alt="Elaborazione alternativa: For this, it is necessary to start from the conceptual idea of the system to be developed, and for this, the need for a system that allows generating temperature ramps from room temperature to about 120ºC of temperature is defined. Some requirements are that the volume and pressure are constant and that the system is closed to allow measuring sensors, devices, biological material and their responses in temperature with constant pressure and volume conditions and thus find the mass (only applies to biological materials). On the other hand, the system must allow going from room temperature to -10 ºC to test other materials or liquids and see if fractures are created. The system must be able to go from high to low temperature, and from low to high, also allowing stability at a temperature over time. &#13;&#10;In addition to all this, applications such as incubation periods of biological material, temperature ramps, temperature inversion and stability for periods, creation of controlled disturbances, maximum and minimum values, all these conditions must be considered. Other aspects also come into play, such as costs and the public to whom the development is directed.&#13;&#10;&#13;&#10;&#13;&#10;"
  v:shapes="_x0000_s1029"></td>

  src="index_file/image029.png"
  alt="Elaborazione alternativa: 4.	CONCEPTUAL IDEA AND MODEL A SYSTEM&#13;&#10;In order to generate a modeling theory for a system like this, it is necessary once the conceptual idea, the phenomena, the variables and some aspects of operation are known, the next objective is to model a system, to characterize it mathematically and find a way to describe it more thoroughly in a more complete, precise, detailed and exact way, with all this information it will be used to perform analyses and generate all of the automatic controllers and also the algorithms seeking that the operation is adapted to the requirements proposed for the interested public. It is essential to obtain physical data and numbers for the mathematical model, in this case table 5 shows the container, volume, weight, area and some properties in our case it consists of a series of equations that represent the behavior of the system, a thermal or thermodynamic section, another section on electronic design and device control, another section on control algorithms, proportional, integral and derivative, as can be seen all these equations do not represent a single model, each one has different representations on the system but they act in a different way, table 2 shows for example the heats of skin, blood, bones and muscles.&#13;&#10;&#13;&#10;"
  v:shapes="_x0000_s1028"></td>

  <td height=151></td>
  <td colspan=4></td>
  <td colspan=33 align=left valign=top><img width=843 height=151
  src="index_file/image031.png"
  alt="Elaborazione alternativa: The developed system is based on a closed container with a transient air flow, in order to determine at certain times in a confined and known space, a thermal condition that allows us to make measurements under controlled and stable conditions, however the thermodynamic laws of energy and matter exchange are applied since the system takes and exchanges these conditions frequently. In this case there are exchanges of energy between hot and cold objects or air, vapor and oxygen molecules.&#13;&#10;&#13;&#10;"
  v:shapes="_x0000_s1033"></td>

  <td colspan=32 align=left valign=top><img width=843 height=82
  src="index_file/image034.png"
  alt="Elaborazione alternativa: In summary, our system is a closed system with a transient flow of air and energy, managed by solenoid valves that open and close the system, to exchange energy and water steam.&#13;&#10;&#13;&#10;"
  v:shapes="_x0000_s1036"></td>

 <tr>
  <td height=178></td>
  <td></td>
  <td colspan=33 align=left valign=top><img width=848 height=178
  src="index_file/image036.png"
  alt="Elaborazione alternativa: For the initial state, the constant volume of the container is considered as known, the medium will be air because variables such as density, temperature and humidity are equal inside and outside the chamber in the first interval from room temperature to 60 °C. The 5 watts electric heating element (Ra) is the actuator in this temperature zone, then the 150-watt electric heating element to heat the systems up to 200°C and finally the cooling effect (Rc). It is better to let the system start from rest at room temperature, using equation 1, [17]."
  v:shapes="_x0000_s1038"></td>
 </tr>

 <tr>
  <td height=182></td>
  <td colspan=2></td>
  <td colspan=32 align=left valign=top><img width=844 height=182
  src="index_file/image037.png"
  alt="Elaborazione alternativa: 2.	EXPERIMENTAL DESIGN, MATERIALS, AND METHODS&#13;&#10;The method applied consists of a multiplatform system called (P). To this empty system (P), a series of applications called (A) will be added. The result of the combination of P and A will give a product that it will be called (CPx), where (x) is the application change. The fictitious product (CPx) is obtained in the medium called (M). In this way a container was selected for thermal applications in various applications such as dehydration, incubation, cell culture, refrigeration and sterilization of dry air.&#13;&#10;&#13;&#10;"
  v:shapes="_x0000_s1040"></td>

 <tr>
  <td height=147></td>
  <td></td>
  <td colspan=31 align=left valign=top><img width=843 height=147
  src="index_file/image040.png"
  alt="Elaborazione alternativa: To obtain the physical model it was necessary to use a container with a known volume that would allow adding sensors and maintaining a treatment space (St) for the products to be treated. Then, an important consideration was the need of a low cost system and finally any person or group, with a minimum knowledge base, could build that. For the demonstration prototype, temperature sensors were added to the actuators and to the internal and external dry air volumes, humidity sensors, pressure and electrical current.&#13;&#10;&#13;&#10;"
  v:shapes="_x0000_s1043"></td>
 </tr>
 <tr>
  <td height=11></td>
 </tr>
 <tr>
  <td height=503></td>
  <td colspan=5></td>
  <td colspan=31 align=left valign=top><img width=841 height=503
  src="index_file/image041.png"
  alt="Elaborazione alternativa: 4.1.	Actuator (Ra): Circuit for high temperature from the middle zone to 200 ° C&#13;&#10;It is possible to connect the actuator A1 directly to the power supply; however, it reaches its maximum temperature in a few minutes, forcing its disconnection to avoid damage. In order to exercise a control action on this element, an electronic circuit (see figure 4) was implemented that will regulate the supply current to the element through the switching of optocouplers DIAC DB32 and TRIAC BTA08400B, generating four different states of regulation at 115/220 VAC (rms). A solid-state relay (SSR) with appropriate switching times can replace the illustrated circuit.&#13;&#10;&#13;&#10;4.2.	Actuator (Rb): temperature control from room temperature up to 60 °C&#13;&#10;This circuit carries out the control action on actuator A2 (5-watt low power resistor). This actuator is governed by the IRF540 MOSFET, which allows to control the current and thus choose a specific thermal cycle (temperature ramp). Figure 6 illustrates how the other components of the system interact, including last generation air fans activated through the element TIP122 and that allow reading of its rotation speed in revolutions per minute (RPM).&#13;&#10;&#13;&#10;4.3.	Actuator (Rc): temperature control from -10 °C to room temperature&#13;&#10;To cool the system, a set of Peltier modules were installed, whose proper operation was guaranteed by a 20-amp power supply. The circuit illustrated in Figure 7 uses a 4N35 optocoupler for the handling of transistors and the drive of the MOSFET IRF540. A set of three circuits is used for cooling through Peltier modules. The cooling stage always starts when the system reaches room temperature [19].&#13;&#10;&#13;&#10;"
  v:shapes="_x0000_s1027"></td>
 </tr>

  <td height=7></td>

 <tr>
  <td height=1000></td>
  <td colspan=4></td>
